 import {useState, useEffect} from 'react'
 import SearchBar from './SearchBar';

 function App() {
  const [products, setProducts] = useState([])
  useEffect(() => {
    setTimeout(() => {
      setProducts([
       'tooth paste',
       'tooth brush',
       'mouth wash',
       'mouth guard'
   ])
    }, 2000)

  }, [])
  const hasProducts = products.length > 0
  return (
    <div className="todo-pp" >
      {hasProducts? <SearchBar products={products} />: 'Loading, please wait'}


    </div>
  );
}

export default App;
